import React from "react";
import "./Header.css";

function Header() {
  return (
    <header>
        <figure>
            <div class="mainpagepic" title="mainpagepic">
                <p id="piccap">Louis Yoon's Portfolio</p>
            </div>
        </figure>
    </header>
  );
}

export default Footer;
